import React, { Component } from 'react';
import axios from 'axios'
import { withRouter } from 'react-router-dom';
import {
  isFaceDetectionModelLoaded
} from '../api/face';

const INIT_STATE = {
  url: null,
  imageURL: null,
  fullDesc: null,
  imageDimension: null,
  error: null,
  loading: false
};

class CargarOpinion extends Component {
  constructor(props) {
    super(props);
    this.state = {
      ...INIT_STATE,
      faceMatcher: null,
      showDescriptors: false,
      isModelLoaded: !!isFaceDetectionModelLoaded(),
      caracteristicas: []
    };
    //this.componentDidMount();
  }

  componentDidMount() {
    axios.get('../json/caracteristicasFoto.json')
        .then(response => this.setState({ caracteristicas: response.data.data }))
  }

  renderUsers() {
    const { caracteristicas } = this.state

    return caracteristicas.map( user => (
        <div key={user.id}>{user.first_name} {user.last_name}</div>
    ))
  }

  render() {
    debugger;
    /*return <div>{ this.renderUsers() }</div>*/

    return (
        <div>
          <div>
            <h2>Comparte tu opini&oacute;n</h2>

            <img src={require('../imagenes/default-avatar.jpg')} />
            <button>Cargar</button>
          </div>
          <div>
            <h2>Descripci&oacute;n</h2>

            <textarea rows="4" cols="50">
            At w3schools.com you will learn how to make a website. We offer free tutorials in all web development technologies.
            </textarea>
            <br/>
            <select>
              <option value="volvo">Labial color HD Velvet. Rosa petal</option>
              <option value="saab">Esmalte profesional 6 en 1 para uñas. Café miel</option>
              <option value="opel">Miss Sexy</option>
              <option value="audi">Audi</option>
            </select>
            <button>Cargar</button>
          </div>
        </div>

    );
  }
}

export default withRouter(CargarOpinion);
